window.bookSummaryJSON = "<p>Jack is out for blood.</p> <p>After being manipulated by his family most of his life, and believing an even worse lie for the past few years, he has finally learned the truth.</p> <p>Now that he knows what V-Soft has taken from him, he’s going to take everything from them, even if the country is destroyed in the process. The plan is to strike from all sides, so that those who still live can watch their lives, and their life’s work be reduced to ashes.</p> <p>But in digging their grave, will Jack wind up buried alongside them?</p>"; 
